import React from 'react'
import BlackLogo from '../Assets/tweed-logo-black.svg'
/**
* @author
* @function Terms
**/

const Terms = (props) => {
  return(
    <div style={{display:'flex', width: '100%'}}>
        <div>
            <img id='blk_logo' src={BlackLogo} alt='tweed logo'></img>
        </div>
    </div>
   )

 }

export default Terms
